export default function todoToShowReducer(state = null, action) {

      switch (action.type) {
          case 'GET_TODO':
            console.log(action.todoToShow)
            return action.todoToShow
          default:
            return {id: 15, title: "Quasi vero qui.", content: "Repellendus deleniti quo est labore voluptas illum voluptatum quia vel pariatur et.", completed: true, user_id: 2}
      }
    }
